import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css'; // Import CSS for styling

const HomePage = () => {
  // Animation state
  const [isVisible, setIsVisible] = useState({
    hero: false,
    templates: false,
    features: false,
    howItWorks: false,
    testimonials: false,
    cta: false
  });

  // Intersection observer setup
  useEffect(() => {
    const observerOptions = {
      threshold: 0.2,
      rootMargin: '-50px'
    };

    const observerCallback = (entries) => {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          setIsVisible(prev => ({ ...prev, [entry.target.id]: true }));
        }
      });
    };

    const observer = new IntersectionObserver(observerCallback, observerOptions);
    
    // Observe all sections
    const sections = document.querySelectorAll('.animate-section');
    sections.forEach(section => observer.observe(section));

    return () => sections.forEach(section => observer.unobserve(section));
  }, []);

  return (
    <div className="homepage-container">
      {/* Hero Section */}
      <section id="hero" className="hero-section animate-section">
        <div className="hero-background"></div>
        
        <div className="container">
          <div className={`hero-content ${isVisible.hero ? 'visible' : ''}`}>
            <div className="hero-text">
              <span className="hero-badge">Professional Resume Builder</span>
              <h1 className="hero-title">
                Create an impressive 
                <span className="highlight"> resume </span> 
                in minutes
              </h1>
              <p className="hero-description">
                Build a standout resume that gets you noticed. Choose from professional templates, customize with ease, and land your dream job.
              </p>
              <div className="hero-buttons">
                <Link to="/create" className="btn btn-primary">
                  Create Your Resume
                </Link>
                <Link to="/templates" className="btn btn-secondary">
                  Browse Templates
                </Link>
              </div>
            </div>
            
            <div className="hero-image">
              <img src="/assets/images/resume-preview.png" alt="Resume preview" />
            </div>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="container mx-auto px-4 py-16">
        <h2 className="text-3xl font-bold text-center text-gray-800 mb-12">
          Why Choose ResuMate
        </h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h3 className="text-xl font-semibold mb-2">Professional Templates</h3>
            <p className="text-gray-600">Choose from dozens of ATS-friendly templates designed by HR professionals.</p>
          </div>
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h3 className="text-xl font-semibold mb-2">Easy Customization</h3>
            <p className="text-gray-600">Personalize your resume with our intuitive editor to match your unique style.</p>
          </div>
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h3 className="text-xl font-semibold mb-2">Save Time</h3>
            <p className="text-gray-600">Create a professional resume in minutes, not hours. Export to PDF or share online.</p>
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="bg-blue-600 text-white py-16">
        <div className="container mx-auto px-4 text-center">
          <h2 className="text-3xl font-bold mb-6">Ready to land your dream job?</h2>
          <p className="text-xl mb-8 max-w-2xl mx-auto">Join thousands of job seekers who have successfully created standout resumes with ResuMate.</p>
          <Link
            to="/create"
            className="bg-white text-blue-600 hover:bg-gray-100 font-medium px-8 py-3 rounded-lg shadow-md inline-block"
          >
            Start Building Your Resume
          </Link>
        </div>
      </section>
    </div>
  );
};

export default HomePage;
